import baseurl from "./baseurl";

export default {
    getAllEntries() {
      return fetch(`${baseurl}/entries`).then((r) => r.json());
    },
    getAllLocations() {
        return fetch(`${baseurl}/locations`).then((r) => r.json());
    }
}
